/* eslint-disable */
const sysSetAppRuntimeModeDtoInType = shape({
  mode: oneOf(["standard","privileged"]).isRequired(),
  note: uu5String(),
  to: datetime()
});

const sysInitAppDtoInType = shape({
  runtimeMode: sysSetAppRuntimeModeDtoInType()
},true,16000);


const sysSetAppConfigDtoInType = shape({
  runtimeMode: sysSetAppRuntimeModeDtoInType()
},true,16000);

